    playbackData.comments = {"703730c2-179e-49f0-a1ec-8cb06d21e206":[{"id":"2e6e87c5-711f-4a4a-9e0b-5ec1c2a91484","displayCommentEventId":"703730c2-179e-49f0-a1ec-8cb06d21e206","displayCommentEventSequenceNumber":0,"developerGroupId":"763c69e1-8467-4eb1-bcd1-513af37c3e15","timestamp":1728615773697,"commentText":"An introduction to some methods we can use to manipulate strings, including <span style=\"font-family: Courier;\">str_c(), str_glue(), str_sub()</span>, and separating wider and longer,&nbsp;","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"197b1a65-044d-48a4-87b7-605c7791abde":[{"id":"2c308bc3-9e3c-4a71-8e57-96382468d177","displayCommentEventId":"197b1a65-044d-48a4-87b7-605c7791abde","displayCommentEventSequenceNumber":66,"developerGroupId":"c827ca56-2ee1-4854-a67a-0f994e5e472f","timestamp":1728619373809,"commentText":"","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":["media/videos/1728619369310-StringIntro.mp4"],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_I.R","viewableBlogText":"","commentTags":["video"],"questionCommentData":null}],"73c97efd-aeed-43a8-903b-0589e93f4c4f":[{"id":"a6a0208d-aac8-401e-9bd8-96c01b7d26c5","displayCommentEventId":"73c97efd-aeed-43a8-903b-0589e93f4c4f","displayCommentEventSequenceNumber":287,"developerGroupId":"c827ca56-2ee1-4854-a67a-0f994e5e472f","timestamp":1728619880751,"commentText":"Our first string manipulation is that of&nbsp;<span style=\"font-family: Courier;\">str_c()</span>, the sting version of the <span style=\"font-family: Courier;\">c()</span> function, which we use for <span style=\"font-weight: bold;\">c</span>ombining <span style=\"font-weight: bold;\">str</span>ings. You'll notice as we progress today that a great deal of our function start with the prefix <span style=\"font-family: Courier;\">str_,</span> an indication that they are to be used on strings (also recall, the term string is synonymous with character vector).<div><br></div><div>Be aware that <span style=\"font-family: Courier;\">str_c()</span> can take in as many string literals (things between quotes like \"_\") and string variables as you'd like, just as<span style=\"font-family: Courier;\"> c()</span> can.&nbsp; You list the various things you want combined between commas. <span style=\"font-family: Courier;\">str_c() </span>will combine the things listed between the commas exactly as they are, adding nothing, so be aware that if you want the things separated by spaces, you need to add them to your strings (e.g. <span style=\"font-family: Courier;\">str_c(\"Hello\",\"World\") </span>will create&nbsp;<span style=\"font-family: Courier;\">\"HelloWorld\",</span> <span style=\"font-weight: bold;\">not</span>&nbsp;<span style=\"font-family: Courier;\">\"Hello World\"</span>).</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_I.R","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"6adf7a44-df94-402a-ba16-965452318775":[{"id":"473352ea-185c-4f1e-877c-c303ec88a96e","displayCommentEventId":"6adf7a44-df94-402a-ba16-965452318775","displayCommentEventSequenceNumber":478,"developerGroupId":"c827ca56-2ee1-4854-a67a-0f994e5e472f","timestamp":1728665827662,"commentText":"By default, <span style=\"font-family: Courier;\">separate_wider_delim()</span> thinks that once we have separated a column, we no longer have use for the original column, and it deletes it from the data frame.&nbsp; For our use case, we want to still keep the email addresses of those who submitted the form, so we will want to set the optional <span style=\"font-family: Courier;\">cols_remove </span>argument to<span style=\"font-family: Courier;\"> FALSE</span> to keep our email addresses.&nbsp;&nbsp;<div><br></div><div>The output of this code is shown below.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1728666582436-strings1.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_I.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"5216adec-bac4-4ce3-8dd1-35b4fa15285d":[{"id":"3968b234-dcfe-4b35-b7b6-d7f15986d7be","displayCommentEventId":"5216adec-bac4-4ce3-8dd1-35b4fa15285d","displayCommentEventSequenceNumber":420,"developerGroupId":"c827ca56-2ee1-4854-a67a-0f994e5e472f","timestamp":1728666127650,"commentText":"Sometimes, we have a string entry in one cell that we wish to split apart somehow, and there is a special character (called a <span style=\"font-style: italic;\">delimiter</span>) that helps us uniformly identify how to split the string.&nbsp; This happens naturally in text (e.g. split apart a sentence by spaces to obtain individual words) often, and the command we use to handle this case is <span style=\"font-family: Courier;\">separate_wider_delim().</span><div><br></div><div>Like pivoting wider, this will separate all text in a column into their own individual columns, with delimiters removed.&nbsp; The arguments to this function include the column to be separated (here<span style=\"font-family: Courier;\"> email</span>), the delimiter <span style=\"font-family: Courier;\">delim</span> by which to separate (here <span style=\"font-family: Courier;\">\"@\"</span>), and the <span style=\"font-family: Courier;\">names</span> of the new columns we wish to create (here<span style=\"font-family: Courier;\"> \"name\" </span>for the first the portion of the email before the delimiter, <span style=\"font-family: Courier;\">\"domain\" </span>for what follows it).</div><div><br></div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_I.R","viewableBlogText":"","commentTags":["delimiter","separate_wider","separate_wider_delim"],"questionCommentData":null}],"466fe62e-fe82-48db-a783-6020f8bff7f4":[{"id":"9d26c571-7eca-4ee4-82c3-38923b045dac","displayCommentEventId":"466fe62e-fe82-48db-a783-6020f8bff7f4","displayCommentEventSequenceNumber":573,"developerGroupId":"c827ca56-2ee1-4854-a67a-0f994e5e472f","timestamp":1728666753531,"commentText":"Isn't it nice to know we all make lots and lots of mistakes?&nbsp; I can't spell View and I also forgot to pipe my data frame in to <span style=\"font-family: Courier;\">separate_wider_delim()</span>, a mistake the playback will show me fixing later.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_I.R","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"8a5ffac8-4f7c-482e-b678-9479a2bee240":[{"id":"f608f044-4fad-4a4e-bbf4-9e24ebdbdd4c","displayCommentEventId":"8a5ffac8-4f7c-482e-b678-9479a2bee240","displayCommentEventSequenceNumber":634,"developerGroupId":"c827ca56-2ee1-4854-a67a-0f994e5e472f","timestamp":1728667059276,"commentText":"Now that we have the <span style=\"font-family: Courier;\">name</span> column in our programmers data frame, we wish to use the formatting of the name&nbsp;to extract the first initial of our programmer.&nbsp; This corresponds to the first letter in the <span style=\"font-family: Courier;\">name</span> column, so we need code to add a column to the data frame that represents the programmer's first initial.<div><br></div><div>For this, we use the <span style=\"font-family: Courier;\">str_sub()</span> function, which create <span style=\"font-weight: bold;\">sub</span>strings from <span style=\"font-weight: bold;\">str</span>ings.&nbsp; &nbsp;This function takes in three arguments: the vector / string we are manipulating (here, the strings in the <span style=\"font-family: Courier;\">name</span> column), the position in the string to start taking the substring (here, the first 1 represents that we are taking the first letter in the string), and the length of substring we wish to consider (this is optional, as we will see).&nbsp; The second 1 we see present means we want a string of length 1.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_I.R","viewableBlogText":"","commentTags":["question"],"questionCommentData":{"allAnswers":["mutate","first_initial","str_sub","We are not adding to the data frame."],"correctAnswer":"first_initial","question":"What is the name of the new column we are adding to <span style=\"font-family: Courier;\">programmers</span>?","explanation":""}}],"38c82ed2-96ca-4d6b-9d47-461a60b76d2c":[{"id":"2565a316-bc5f-4597-a877-4bf3dbcfc423","displayCommentEventId":"38c82ed2-96ca-4d6b-9d47-461a60b76d2c","displayCommentEventSequenceNumber":693,"developerGroupId":"c827ca56-2ee1-4854-a67a-0f994e5e472f","timestamp":1728667322917,"commentText":"We can similarly create a column for the programmer's last name by removing the first initial from the name column and considering everything from the second position to the end of the string.&nbsp; We can still use <span style=\"font-family: Courier;\">str_sub()</span> for this, we just leave the length argument missing.&nbsp; By default, <span style=\"font-family: Courier;\">str_sub()</span> will presume you want a substring as long as possible here, and will give you the rest of the word.<div><br></div><div>You don't need to worry about demanding a string that is too long.&nbsp; If you were to ask, for example, for a string of length 1000 starting from the second position in name onward, you would not generate a syntax error.&nbsp; You would simply get a string as close to length 1000 as possible with what remains of the word.&nbsp; In that way,<span style=\"font-family: Courier;\"> str_sub(name,2,1000) </span>would behave the same as what we have here, just so long as there are no names longer than 1000 characters.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_I.R","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"d8f73e83-9c43-421f-8e2a-562a7e1ac682":[{"id":"d6a0a1d9-467d-4283-8a1c-d4866c82bc7a","displayCommentEventId":"d8f73e83-9c43-421f-8e2a-562a7e1ac682","displayCommentEventSequenceNumber":702,"developerGroupId":"c827ca56-2ee1-4854-a67a-0f994e5e472f","timestamp":1728667466205,"commentText":"As people, when we use someone's first initial in place of their name, we typically capitalize it.&nbsp; There are string functions called <span style=\"font-family: Courier;\">toupper()</span> and <span style=\"font-family: Courier;\">tolower()</span> in R that work to give you the upper and lower case versions of the string passed to them as parameters.&nbsp; These functions are most helpful when you want to match words together based on their meanings but you don't want to think about the grammatical rules of English (e.g. My and my are truly the same word).","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_I.R","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"31880179-1831-48dc-ad1c-5bdb2f2b0861":[{"id":"8ecf7e56-d3cd-4b64-bc34-e23a07bbceb3","displayCommentEventId":"31880179-1831-48dc-ad1c-5bdb2f2b0861","displayCommentEventSequenceNumber":711,"developerGroupId":"c827ca56-2ee1-4854-a67a-0f994e5e472f","timestamp":1728667679183,"commentText":"","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_I.R","viewableBlogText":"","commentTags":["question"],"questionCommentData":{"allAnswers":["GHOPPER","HOPPER","Ghopper","Hopper"],"correctAnswer":"HOPPER","question":"For the <span style=\"font-family: Courier;\">name</span> ghopper, what will be displayed by <span style=\"font-family: Courier;\">toupper(str_sub(name,2))</span>?","explanation":"Everything will be capitalized by<span style=\"font-family: Courier;\"> toupper()</span>, but starting the substring at position 2 will omit the g."}}],"ecb6a7a3-71af-4762-aa0d-95f34dab7580":[{"id":"5b3e3ba3-998f-480d-9468-2a8986d52305","displayCommentEventId":"ecb6a7a3-71af-4762-aa0d-95f34dab7580","displayCommentEventSequenceNumber":770,"developerGroupId":"c827ca56-2ee1-4854-a67a-0f994e5e472f","timestamp":1728667901988,"commentText":"This line of code is a lot, and is only accomplished by putting everything together we've learned thus far.&nbsp; To the last name (everything in positions 2 onward of the <span style=\"font-family: Courier;\">name </span>column), we are going to treat the second letter and letters 3 onward differently.&nbsp; Let's capitalize the first letter of the last name (the second letter in the <span style=\"font-family: Courier;\">name</span> column) and then <span style=\"font-weight: bold;\">c</span>ombine the capitalized first letter of the last name with the lowercase versions of the rest of the last name into one entity: a last name with a capitalized first letter.<div><br></div><div>The output produced by this code is shown below.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1728667900629-string2.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_I.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"abc0944b-6b0b-4b7a-8759-6f40621ec605":[{"id":"b73cfa73-faf0-47f1-92ae-2e6e94aa84d3","displayCommentEventId":"abc0944b-6b0b-4b7a-8759-6f40621ec605","displayCommentEventSequenceNumber":838,"developerGroupId":"c827ca56-2ee1-4854-a67a-0f994e5e472f","timestamp":1728667923693,"commentText":"This is where I realized I couldn't spell View.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_I.R","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"b5fff94a-9d38-4141-8e2a-d528161a8723":[{"id":"d0fd187c-c90e-45fe-a528-0797d4e074ad","displayCommentEventId":"b5fff94a-9d38-4141-8e2a-d528161a8723","displayCommentEventSequenceNumber":913,"developerGroupId":"c827ca56-2ee1-4854-a67a-0f994e5e472f","timestamp":1728668016074,"commentText":"(before I tell you about <span style=\"font-family: Courier;\">separate_longer_delim()</span>, let me fix the fact that I forgot to pipe in my data previously!)","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1728668011867-oopspuppy.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_I.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"f37f2e9f-b4e7-450a-8c9d-52be98427dd1":[{"id":"10697df9-3e8d-47c8-94f7-a55cfbab070e","displayCommentEventId":"f37f2e9f-b4e7-450a-8c9d-52be98427dd1","displayCommentEventSequenceNumber":983,"developerGroupId":"c827ca56-2ee1-4854-a67a-0f994e5e472f","timestamp":1728668048057,"commentText":"Where before we separated wider from our data, making more columns from our <span style=\"font-family: Courier;\">email</span> column, we now want to follow the rule that every entry in a given cell should be a single observation.&nbsp; That is, the lists of values that appear in each single cell entry of the <span style=\"font-family: Courier;\">programming_languages</span> column should be split apart, with each language being involved in their own row.&nbsp; This will require us to make the data longer, not wider, so we use a <span style=\"font-family: Courier;\">separate_longer()</span> function.&nbsp; We choose <span style=\"font-family: Courier;\">separate_longer_delim()</span> because as we did earlier, we will use a delimiter to determine how to split the strings.<div><br></div><div>The first argument we provide to <span style=\"font-family: Courier;\">separate_longer_delim()</span> is the column we will be lengthening; here, <span style=\"font-family: Courier;\">programming_languages</span>.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_I.R","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"9c469f21-0e52-4a31-8ea0-531fe7ebb462":[{"id":"7ae780df-b3d0-4929-b457-41b4a6928b87","displayCommentEventId":"9c469f21-0e52-4a31-8ea0-531fe7ebb462","displayCommentEventSequenceNumber":1052,"developerGroupId":"c827ca56-2ee1-4854-a67a-0f994e5e472f","timestamp":1728676702277,"commentText":"The second argument we provide to <span style=\"font-family: Courier;\">separate_longer_delim() </span>is ... the delimiter on which to split!&nbsp; The argument is technically called <span style=\"font-family: Courier;\">delim</span> for brevity.<div><br></div><div><span style=\"font-weight: bold;\">Pro tip:</span> Here, we use<span style=\"font-family: Courier;\"> \", \" </span>(a comma with a space) as our delimiter.&nbsp; If the space is NOT specified as part of what to remove, the space will not be removed.&nbsp; This can cause trouble later when / if we try to filter or match values.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_I.R","viewableBlogText":"","commentTags":["separate_longer","separate_longer_delim"],"questionCommentData":null}],"359cac59-3a6d-4ea4-aca6-8a2a7ab39963":[{"id":"9a17495a-ee3c-422a-9194-e7b2f4638476","displayCommentEventId":"359cac59-3a6d-4ea4-aca6-8a2a7ab39963","displayCommentEventSequenceNumber":1215,"developerGroupId":"c827ca56-2ee1-4854-a67a-0f994e5e472f","timestamp":1728680623624,"commentText":"Last but not least, let's see an application of how to use the newly tidied, more informed data that we've created.<div><br></div><div>Suppose we wish to search for all programmers who are able to tutor a specific language.&nbsp; First, let's specify the language, and now let's filter our data for tutors available to tutor that language.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_I.R","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"b36c5845-2b40-407f-90f5-5f32e8cd0e69":[{"id":"b9f11fb9-0110-40ea-9bb7-74807d6d4d15","displayCommentEventId":"b36c5845-2b40-407f-90f5-5f32e8cd0e69","displayCommentEventSequenceNumber":1366,"developerGroupId":"c827ca56-2ee1-4854-a67a-0f994e5e472f","timestamp":1728686502365,"commentText":"<span style=\"font-family: Courier;\">str_glue() </span>is just like <span style=\"font-family: Courier;\">str_c() </span>but it has a special feature to help us combine string variables and string literals together.&nbsp; If you have a variable you wish to appear in <span style=\"font-family: Courier;\">str_glue()</span> replaced with its literal value, you can enter the variable name within braces.&nbsp; so for example, if first initial is <span style=\"font-family: Courier;\">G</span>, <span style=\"font-family: Courier;\">str_glue(\"Hello {first_initial}.\"</span>) will render <span style=\"font-family: Courier;\">\"Hello G.\"</span>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_I.R","viewableBlogText":"","commentTags":["str_glue"],"questionCommentData":null}],"398eedf4-7447-4a84-ba3c-125f05f2c44f":[{"id":"db411328-552d-4f81-b455-5528297a448a","displayCommentEventId":"398eedf4-7447-4a84-ba3c-125f05f2c44f","displayCommentEventSequenceNumber":1576,"developerGroupId":"c827ca56-2ee1-4854-a67a-0f994e5e472f","timestamp":1728687097358,"commentText":"The final result of our <span style=\"font-family: Courier;\">str_glue()</span> is shown below:","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1728687058796-email_last.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/strings_I.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}]};
